import math
import sys
import frequency

def distance(base):

    basedict = frequency.letter_frequency(base)
    unknowndict = {'A': 0.08161939411939412, 'B': 0.01368985743985744, 'C': 0.022275022275022274, 'D': 0.04579373329373329, 'E': 0.12603021978021978, 'F': 0.018571799821799823, 'G': 0.02349086724086724, 'H': 0.06844000594000595, 'I': 0.06975794475794476, 'J': 0.001355063855063855, 'K': 0.010747698247698247, 'L': 0.04378898128898129, 'M': 0.019555613305613305, 'N': 0.06515444015444015, 'O': 0.07561441936441936, 'P': 0.014144639144639145, 'Q': 0.0019397831897831899, 'R': 0.05049005049005049, 'S': 0.060346747846747845, 'T': 0.09920738045738045, 'U': 0.032196688446688444, 'V': 0.007861226611226612, 'W': 0.024836649836649835, 'X': 0.0013736263736263737, 'Y': 0.020994208494208494, 'Z': 0.0007239382239382239}

    sum = 0
    for index in basedict:
        sum += euclidean_helper(basedict[index], unknowndict[index])

    return math.sqrt(sum)

def euclidean_helper(a, b):
    return (a-b) ** 2

def main():
    print(distance(''))


if __name__ == "__main__":
    main()